import React from 'react';

function Header() {
  return (
    <header>
      <h1>Heddo!!!</h1>
      {/* We're using JSX in React, so we need to use the below syntax instead */}
      <img style={{ height: '60px' }} src="logo-wide.png" />
    </header>
  );
}

export default Header;
